Virginia Department of Education - VDOE
October 17, 2019 at 3:50 PM ·

@GovernorVA awards $6 million in School Security Equipment Grants to help protect students and teachers in 340 schools. The grants will pay for upgrades to include video monitoring systems, mass notification systems, and visitor-identification systems: http://ow.ly/5P2g50wNLK2
